// src/components/Calender.js

import React from "react";
import ReactCalendar from "react-calendar"; // Ensure you have react-calendar installed
import 'react-calendar/dist/Calendar.css'; // Import CSS for the calendar
import '../pages/Events.css'; // Adjusted path to point to Events.css in the pages directory

const Calender = ({ date, onDateChange }) => {
  return (
    <div className="calendar-container">
      <ReactCalendar 
        onChange={onDateChange}
        value={date}
        className="react-calendar"
      />
    </div>
  );
};

export default Calender;
